import React, { useState } from "react";

const Header = function(){
    let [amount, changeAmount] = useState(0);

    function Increment(){
      changeAmount(amount++);
    }
  
    function Dicrement(){
      changeAmount(amount--);
    }
    return(
        <div>
            <h1>{amount}</h1>
            <button onClick={Increment}>Increment</button>
            <button onClick={Dicrement}>Dicrement</button>
        </div>
    );
}

export default Header;
